import React from 'react';
import Button from '@material-ui/core/Button';
import DeleteOutlineIcon from '@material-ui/icons/DeleteOutline';

const CreateNode=()=>{
return(<>
    <div className='note' style={{height:'auto', width:'30%'}}>

    <h1>Title</h1>
    <br />
    <p>This is content area Emmet  But it can do more! You can control how much you get, place it within HTML structure as it expands, and get different bits of it in repeated elements.</p>
         <br /> <Button className='dbutton' variant="contained" style={{backgroundColor:'white',borderRadius:'50%'}}>
        <DeleteOutlineIcon className='dbuttonIcon'/>
      </Button>

    </div>
</>)
}
export default CreateNode;
